import React,{Component} from 'react';
import {
  Switch,
  Route
} from "react-router-dom";
import {useSelector} from 'react-redux';
import Login from './login';
import Register from './register';
import Accounts from './Accounts';
import Profile from './Profile';
import Nav from './Nav';
import Password from './Password';
import Remove from './Remove';
import './App.css';
import 'tachyons';

class App extends Component {
  constructor(){
    super();
    this.state={
      user:{
    }}
  }
  render(){
    const logIn=useSelector(state=>state.logReducer);
      return (
      <div className="App">
        <nav class="ph3 ph5-ns pv4 w-100">
  <div class="nowrap overflow-x-auto">

        <Nav link="signin" name="Sign In"/>
        <Nav link="signup" name="Sign Up"/>
        <Nav link="users" name="Active Users"/>
        <Nav link="profile" name="Profile"/>
        </div>
          </nav>
        <Switch>
          <Route path="/signin">
            <Login/>
          </Route>
          <Route path="/signup">
            <Register/>
          </Route>
          {logIn?<div>
          <Route path="/users">
            <Accounts/>
          </Route>
          <Route path="/profile">
            <Profile/>
            <br/>
            <Password/>
            <br/>
            <Remove/>
            <br/>
          </Route>
          </div>
          :
          ''}
        </Switch>

      </div>
    );
    }
}

export default App;
